import "./App.css";
import Header from "./componentes/Header"
import styled from 'styled-components'

const AppContainer = styled.div`
      width: 100vw;
      height: 100vh;
      background-image: linear-gradient(90deg,#002f52 35%,#326589 165%);

    li{
      list-style: none;
    } 

`

function App() {
  return (
    <AppContainer>
        <Header/>
    </AppContainer>
  );
}

export default App;
